import React from 'react';
import SimplePage from './pages/SimplePage';

const App: React.FC = () => {
  return (
    <div style={{ minHeight: '100vh', backgroundColor: '#f8f9fa' }}>
      <SimplePage />
    </div>
  );
};

export default App;
